import React from 'react';
import { Link } from 'react-router-dom'

const Home = () => {
  return (
    <>
      <h3>Admin</h3>
      <ul style={{listStyleType: 'none'}}>
        <li><Link to={'/servers'}>Servers</Link></li>
      </ul>
    </>
  )
};
export default Home;
